# frozen_string_literal: true

require_relative './database_manager'

class TXCourtsScrape < Hamster::Scraper
  URL = 'https://search.txcourts.gov/CaseSearch.aspx?coa=cossup'
  DEFAULT_LINK = 'https://search.txcourts.gov/'
  LINK = 'https://search.txcourts.gov/Case.aspx'

  THREADS_COUNT_SCRAPING = 3
  DIR_TEST = "../HarvestStorehouse/project_0399/test"

  COURT_MAP = {
    'SC' => ['Supreme Court', 'Supreme Court', 344, 'coa=cossup'],
    'CCA' => ['Court of Criminal Appeals', 'Criminal Appeals', 465, 'coa=coscca'],
    'COA01' => ['First Court of Appeals', '1st Court', 466, 'coa=coa01'],
    'COA02' => ['Second Court of Appeals', '2nd Court', 467, 'coa=coa02'],
    'COA03' => ['Third Court of Appeals', '3rd Court', 468, 'coa=coa03'],
    'COA04' => ['Fourth Court of Appeals', '4th Court', 469, 'coa=coa04'],
    'COA05' => ['Fifth Court of Appeals', '5th Court', 470, 'coa=coa05'],
    'COA06' => ['Sixth Court of Appeals', '6th Court', 471, 'coa=coa06'],
    'COA07' => ['Seventh Court of Appeals', '7th Court', 472, 'coa=coa07'],
    'COA08' => ['Eighth Court of Appeals', '8th Court', 473, 'coa=coa08'],
    'COA09' => ['Ninth Court of Appeals', '9th Court', 474, 'coa=coa09'],
    'COA10' => ['Tenth Court of Appeals', '10th Court', 475, 'coa=coa10'],
    'COA11' => ['Eleventh Court of Appeals', '11th Court', 476, 'coa=coa11'],
    'COA12' => ['Twelfth Court of Appeals', '12th Court', 477, 'coa=coa12'],
    'COA13' => ['Thirteenth Court of Appeals', '13th Court', 477, 'coa=coa13'],
    'COA14' => ['Fourteenth Court of Appeals', '14th Court', 478, 'coa=coa14']
  }

  def initialize
    super
    @dirname_main_part = create_dir("#{storehouse}main_part")
    @dirname_second_part = create_dir("#{storehouse}second_part")
    @semaphore = Mutex.new
    @filter = ProxyFilter.new(duration: 3.hours, touches: 1000)
    @filter.ban_reason = proc { |response| ![200, 304].include?(response.status) || response.body.size.zero? }
    @scrape_dev_name = 'Dmitry Suschinsky'
    @run_id = nil
  end

  # download main pages
  def main_first_part(date)
    year = date[:year]
    start_week = date[:start_week]
    end_week = date[:end_week]
    dirname = create_dir("#{storehouse}main_part/#{year}")

    save_index_pages(start_week, end_week, dirname)

    Hamster.report(to: 'dmitiry.suschinsky', message: "#399 Texas Courts MAIN PART #1 - DONE #{year}")

  rescue ActiveRecord::ConnectionTimeoutError
    sleep(5)
    retry
  rescue SystemExit, Interrupt, StandardError => e
    error_msg = e.backtrace.join("\n")
    Hamster.report(to: 'dmitiry.suschinsky', message: "#399 Texas Courts MAIN PART #1 - exception:\n #{error_msg}")
  end

  # download personal pages
  def main_second_part(year)
    # SCRAPE PART #2
    count = 0
    dirname = create_dir("#{storehouse}second_part/#{year}")


    file_list = Array.new
    Dir["#{storehouse}main_part/#{year}/*.gz"].each do |path|
      next if path.to_s.include?('DONE')
      # next if !path.to_s.include?('DONE')
      file_list.push(path)
    end
    total_count = file_list.size

    file_list.each do |path|
      count += 1
      total_count -= 1
      links = Array.new
      file = read_gz(path)
      index = 0
      filename = path.scan(/#{Regexp.escape("#{storehouse}main_part/#{year}/")}(\S+\.gz)$/)

      scan_values = path.scan(/(\d{4}-\d{2}-\d{2})-(\d{4}-\d{2}-\d{2})_(\d+).gz$/)

      document = Nokogiri::HTML.parse(file)
      trs = document.xpath('//tr')
      trs.shift.css('th')
      count_records = trs.size

      trs.each do |tr|
        court_name = tr.xpath('./td')[0].text
        court_url = COURT_MAP["#{tr.xpath('./td')[10].text}"][3]
        links << {
          :href => "#{LINK}?cn=#{court_name}&#{court_url}",
          :court_name => court_name
        }
      end

      threads_links = Array.new(3) do
        Thread.new do
          sleep(rand(0.1..10.1))
          loop do
            break if links.size == 0
            link = nil

            @semaphore.synchronize do
              link = links.pop
              index += 1
            end
            break if link.nil?

            response = connect_to(link[:href])
            content = Nokogiri::HTML.parse(response.body)

            pack_to_gz(dirname, scan_values[0][0] + "_#{link[:court_name]}", content) if response.status == 200
          end
        end
      end
      threads_links.each(&:join)

      File.rename(path, path.gsub(filename[0][0].to_s, "DONE_#{filename[0][0].to_s}")) if File.exist?(path)
    end
    Hamster.report(to: 'Dmitiry Suschinsky', message: '#399 Texas Courts - MAIN PART #2 - DONE')

  rescue ActiveRecord::ConnectionTimeoutError
    sleep(5)
    retry
  rescue SystemExit, Interrupt, StandardError => e
    error_msg = e.backtrace.join("\n")
    Hamster.report(to: 'dmitiry.suschinsky', message: "#399 Texas Courts MAIN PART #2 - exception:\n #{error_msg}")
  end

  # parse each page
  def parse_part(year)
    # PARSE PART
    count = 0
    mark_as_started

    dirname = "#{storehouse}second_part/#{year}"

    file_list = Array.new
    Dir["#{dirname}/*.gz"].each do |path|
      file_list.push(path) unless path.to_s.include?('DONE')
    end

    total_count = file_list.size

    threads_links = Array.new(7) do
      Thread.new do
        # sleep(rand(0.1..3.1))
        loop do
          break if file_list.size == 0
          path = nil

          @semaphore.synchronize do
            path = file_list.pop
          end
          break if path.nil?

          count += 1
          total_count -= 1

          file = read_gz(path)
          filename = path.scan(/#{Regexp.escape(dirname)}\/(\S+\.gz)$/)

          case_detail = TxCaseDetail.new(
            COURT_MAP,
            file,
            LINK,
            @scrape_dev_name,
            @run_id
          )

          tx_case_info = case_detail.tx_case_info
          case_id = tx_case_info[:case_id]

          document_list = TxDocumentList.new(
            COURT_MAP,
            file,
            DEFAULT_LINK,
            @scrape_dev_name,
            @run_id,
            LINK,
            case_id
          )

          tx_put_all_in_db(case_detail, document_list, tx_case_info)

          File.rename(path, path.gsub(filename[0][0].to_s, "DONE_#{filename[0][0].to_s}")) if File.exist?(path)
        end
      end
    end
    threads_links.each(&:join)

    Hamster.report(to: 'dmitiry.suschinsky', message: "#399 Texas Courts - PARSE PART - DONE #{year}")

  rescue ActiveRecord::ConnectionTimeoutError
    sleep(5)
    retry
  rescue SystemExit, Interrupt, StandardError => e
    error_msg = e.backtrace.join("\n")
    Hamster.report(to: 'dmitiry.suschinsky', message: "#399 Texas Courts - exception:\n #{error_msg}")
  end

  def update(start_date, end_date)
    if start_date.blank? && end_date.blank?
      date = get_last_week_dates
    else
      date = { start_week: Date.parse(start_date), end_week: Date.parse(end_date), year: Time.now.year.to_s }
    end

    sleep 10
    main_first_part(date)

    sleep 30
    main_second_part(date[:year])

    sleep 30
    parse_part(date[:year])
  end

  def save_index_pages(start_week, end_week, dirname)
    form_data = get_form_data(start_week, end_week)

    page = connect_to(url: URL, method: :post, req_body: form_data, proxy_filter: @filter, ssl_verify: false)&.body
    count = get_count_records(page)

    pack_to_gz(dirname, "#{start_week.to_s.gsub('/', '_')}-#{end_week.to_s.gsub('/', '_')}_#{count}.html", page) if page != nil && count > 0
  end

  def get_form_data(start_week, end_week)
    form_data = {
      '__VIEWSTATEGENERATOR' => '64154690',
      'ctl00$ContentPlaceHolder1$SearchType' => 'rbSearchByCase',
      'ctl00$ContentPlaceHolder1$chkAllCourts' => 'on',
      'ctl00$ContentPlaceHolder1$ddlCourts' => '2f9a4941-9b55-463d-a622-b6b304b19142',
      'ctl00$ContentPlaceHolder1$olCaseType' => '0',
      'ctl00$ContentPlaceHolder1$chkListCourts$0' => 'true',
      '__EVENTTARGET' => 'ctl00$ContentPlaceHolder1$btnExport',
      'ctl00$ContentPlaceHolder1$txtDateFiledStart$dateInput' => "#{start_week.strftime("%m")}/#{start_week.strftime("%d")}/#{start_week.year}",
      'ctl00_ContentPlaceHolder1_txtDateFiledStart_dateInput_ClientState' => "{\"enabled\":true,\"emptyMessage\":\"\",\"validationText\":\"#{start_week.year}-#{start_week.strftime("%m")}-#{start_week.strftime("%d")}-00-00-00\",\"valueAsString\":\"#{start_week.year}-#{start_week.strftime("%m")}-#{start_week.strftime("%d")}-00-00-00\",\"minDateStr\":\"1900-01-01-00-00-00\",\"maxDateStr\":\"2099-12-31-00-00-00\",\"lastSetTextBoxValue\":\"#{start_week.strftime("%m")}/#{start_week.strftime("%d")}/#{start_week.year}\"}",
      'ctl00$ContentPlaceHolder1$txtDateFiledEnd$dateInput' => "#{end_week.strftime("%m")}/#{end_week.strftime("%d")}/#{end_week.year}",
      'ctl00_ContentPlaceHolder1_txtDateFiledEnd_dateInput_ClientState' => "{\"enabled\":true,\"emptyMessage\":\"\",\"validationText\":\"#{end_week.year}-#{end_week.strftime("%m")}-#{end_week.strftime("%d")}-00-00-00\",\"valueAsString\":\"#{end_week.year}-#{end_week.strftime("%m")}-#{end_week.strftime("%d")}-00-00-00\",\"minDateStr\":\"1900-01-01-00-00-00\",\"maxDateStr\":\"2099-12-31-00-00-00\",\"lastSetTextBoxValue\":\"#{end_week.strftime("%m")}/#{end_week.strftime("%d")}/#{end_week.year}\"}",
      '__VIEWSTATE' => ''
    }
    URI.encode_www_form(form_data)
  end

  def finish(run_id)
    TxSaacCaseInfo.where.not(touched_run_id: run_id).update(deleted: 1)
    TxSaacCaseInfo.where.not(touched_run_id: run_id).update(deleted: 1)
    TxSaacCaseActivities.where.not(touched_run_id: run_id).update(deleted: 1)
    TxSaacCaseActivities.where.not(touched_run_id: run_id).update(deleted: 1)
    TxSaacCaseActivities.where.not(touched_run_id: run_id).update(deleted: 1)
    TxSaacCaseAdditionalInfo.where.not(touched_run_id: run_id).update(deleted: 1)
    TxSaacCaseRun.where(id: run_id).update(status: 'done')
  end

  def mark_as_done
    last_row = TxSaacCaseRun.last
    if last_row && last_row.status == 'parse started'
      @run_id = last_row.id
      TxSaacCaseRun.find(@run_id).update(status: 'done')
    end
  end

  def rename_files(year)
    @dirname_second_part = create_dir("#{storehouse}second_part/#{year}")

    file_list = Array.new
    Dir["#{@dirname_second_part}/*.gz"].each do |path|
      file_list.push(path) if path.to_s.include?('DONE')
    end

    file_list.each do |path|
      File.rename(path, path.gsub('DONE_', '')) if File.exist?(path)
    end
  end

  private

  def pack_to_gz(dir, name, html)
    Zlib::GzipWriter.open(gz_file(dir, name)) do |gz|
      gz.write(html)
    end
    File.rename(gz_file(dir, name), gz_file(dir, name))
  end

  def create_dir(dir)
    dirname = dir
    FileUtils.mkdir_p(dirname) unless File.directory?(dirname)
    "#{dirname}/"
  end

  def gz_file(dir, name)
    "#{dir}#{name.gsub(/\..+/, '')}.gz"
  end

  def read_gz(dir)
    Zlib::GzipReader.open(dir, &:read)
  end

  def get_time_periods(year)
    week_nums = Date.new(year, 12, 28).strftime('%-V')
    week = 0
    periods = Hash.new

    week_nums.to_i.times do
      week += 1
      start_week = Date.commercial(year, week, 1)
      end_week = Date.commercial(year, week, 7)

      periods[week] = [start_week, end_week]
    end
    periods
  end

  def get_last_week_dates
    date = Date.today
    start_week = date - date.wday - 6
    end_week = date - date.wday

    { start_week: start_week, end_week: end_week, year: date.year.to_s}
  end

  def get_count_records(response)
    document = Nokogiri::HTML(response)
    count_records = 0
    document.xpath('//tr').each { |x| count_records += 1 }
    count_records
  end

  def mark_as_started
    TxSaacCaseRun.create
    @run_id = TxSaacCaseRun.last.id
    TxSaacCaseRun.find(@run_id).update(status: 'parse started')
    TxSaacCaseRun.find(@run_id - 1).update(status: 'done') if @run_id > 1
  end
end
